import React, {useState} from "react";
import logo from '../images/sapphirelogo.svg';
import { animateScroll as scroll } from "react-scroll";
import Services from './Tabs/Services';
import About from './Tabs/About';
import Philantrophy from './Tabs/Philantrophy';
import '../css/foundation/assets/css/foundation.css';
import { FaAlignLeft } from 'react-icons/fa';

const scrollToTop = () => { scroll.scrollToTop() }

const Navbar = () => {
  const [toggle, setToggle] = useState(false);

  return (
    <nav className="nav" id="navbar">
      <div className="nav-content">
        <button onClick={() => setToggle(!toggle)}>
          <FaAlignLeft color="#111"/>
        </button>
        <ul className={toggle ? "nav-items links show-nav" : "nav-items links"}>
          <Services />
          <About />
          <Philantrophy />
        </ul>
        <img
          src={logo}
          className="nav-logo"
          alt="Logo."
          onClick={scrollToTop}
        />
      </div>
    </nav>
  );
}

